import React from 'react';
import Hero from './Hero';
import StudentSection from './StudentSection';
import Schedule from './Schedule';
import Contact from './Contact';

const Home = () => {
  return (
    <div className="home">
      <Hero />
      <StudentSection />
      <Schedule />
      <Contact />
    </div>
  );
};

export default Home;
